    <p>{`A full-featured pure desktop GUI client, RedisInsight supports RediSearch. `}<a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisearch/"
      }}>{`RediSearch`}</a>{`  is a powerful indexing, querying, and full-text search engine for Redis. It is one of the most mature and feature-rich Redis modules.With RedisInsight, the below functionalities are possible`}</p>
    <ul>
      <li parentName="ul">{`Multi-line for building queries`}</li>
      <li parentName="ul">{`Added ability to submit query with ‘ctrl + enter’ in single line mode`}</li>
      <li parentName="ul">{`Better handling of long index names in index selector dropdown`}</li>
      <li parentName="ul">{`Fixed bug with pagination on queries with whitespace in the query string`}</li>
      <li parentName="ul">{`Support Aggregation`}</li>
      <li parentName="ul">{`Support Fuzzy logic`}</li>
      <li parentName="ul">{`Simple and complex conditions`}</li>
      <li parentName="ul">{`Sorting`}</li>
      <li parentName="ul">{`Pagination`}</li>
      <li parentName="ul">{`Counting`}</li>
    </ul>
    <p>{`RediSearch allows you to quickly create indexes on datasets (Hashes), and uses an incremental indexing approach for rapid index creation and deletion. The indexes let you query your data at lightning speed, perform complex aggregations, and filter by properties, numeric ranges, and geographical distance.`}</p>
    <h3 {...{
      "id": "step-1-create-redis-database"
    }}>{`Step 1. Create Redis database`}</h3>
    <p><a parentName="p" {...{
        "href": "/explore/redismod"
      }}>{`Follow this link to create Redis database using Docker container `}</a>{`that comes with RediSearch module enabled`}</p>
    <h2 {...{
      "id": "step-2-download-redisinsight"
    }}>{`Step 2: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password.  Then click “ADD REDIS DATABASE”.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
    <p>{`We will look at 2 datasets - one is OpenBeerDB and other is Movie datasets.
Let us begin with OpenBeerDB sample dataset.`}</p>
    <h3 {...{
      "id": "step-3-openbeerdb-sample-dataset"
    }}>{`Step 3. OpenBeerDB sample dataset`}</h3>
    <p>{`To demonstrate RediSearch, we will use OpenbeerDB dataset. The dataset is available publicly for general public under `}<a parentName="p" {...{
        "href": "https://openbeerdb.com"
      }}>{`openbeerdb.com`}</a>{` `}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image2.png").default} title="image_tooltip" /></p>
    <p>{`Let us clone the repository to access the dataset:`}</p>
    <pre><code parentName="pre" {...{}}>{`$ git clone https://github.com/redis-developer/redis-datasets
cd redis-datasets/redisearch/openbeerdb
`}</code></pre>
    <h3 {...{
      "id": "step-4-installing-prerequisite-packages"
    }}>{`Step 4. Installing prerequisite packages`}</h3>
    <pre><code parentName="pre" {...{}}>{`$ brew install python3
$ pip3 install -r requirements.txt
`}</code></pre>
    <h3 {...{
      "id": "step-5-importing-the-data"
    }}>{`Step 5. Importing the data`}</h3>
    <pre><code parentName="pre" {...{}}>{`$ python3 import.py --url redis://localhost:6379
Importing categories…
Importing styles...
Importing breweries...
Adding beer data to RediSearch..

`}</code></pre>
    <h3 {...{
      "id": "step-6-choose-redisearch-under-redisinsight-browser-tool"
    }}>{`Step 6: Choose “RediSearch” under RedisInsight browser tool`}</h3>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} title="image_tooltip" /></p>
    <p>{`Run the below query:`}</p>
    <pre><code parentName="pre" {...{}}>{`"@abv:[5 6]"
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image4.png").default} title="image_tooltip" /></p>
    <p>{`You can click on “{:} “ to get a JSON view as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image5.png").default} title="image_tooltip" /></p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image6.png").default} title="image_tooltip" /></p>
    <p>{`You can download the data in CSV format.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image7.png").default} title="image_tooltip" /></p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image8.png").default} title="image_tooltip" /></p>
    <h4 {...{
      "id": "query-all-beers-with-abv-higher-than-5-but-lower-than-6"
    }}>{`Query: All beers with ABV higher than 5% but lower than 6%`}</h4>
    <p>{`The beers are added to the RediSearch index weighted by ABV. So by default, the results will be ordered by ABV highest to lowest. Both ABV and IBU are sortable, so you can order results by either of these fields using sortby in the query`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image9.png").default} title="image_tooltip" /></p>
    <h4 {...{
      "id": "query-all-beers-with-abv-higher-than-5-but-lower-than-6-within-the-specified-limits"
    }}>{`Query: All beers with ABV higher than 5% but lower than 6% within the specified limits`}</h4>
    <pre><code parentName="pre" {...{}}>{`"@abv:[5 6]" limit 0 100
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image10.png").default} title="image_tooltip" /></p>
    <h4 {...{
      "id": "query-find-out-irish-ale-and-german-ale-beers-with-abv-greater-than-9"
    }}>{`Query: Find out Irish Ale and German Ale beers with ABV greater than 9%:`}</h4>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image11.png").default} title="image_tooltip" /></p>
    <h3 {...{
      "id": "step-7-using-aggregation"
    }}>{`Step 7. Using AGGREGATION`}</h3>
    <p>{`Aggregations are a way to process the results of a search query, group, sort and transform them - and extract analytic insights from them. Much like aggregation queries in other databases and search engines, they can be used to create analytics reports, or perform Faceted Search style queries.`}</p>
    <p>{`For example, indexing a web-server's logs, we can create a report for unique users by hour, country or any other breakdown; or create different reports for errors, warnings, etc.`}</p>
    <p>{`Let's run the aggregation query`}</p>
    <pre><code parentName="pre" {...{}}>{`FT.AGGREGATE "beerIdx" "@abv:[5 6]" limit 0 1060 GROUPBY 1 @breweryid
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image12.png").default} title="image_tooltip" /></p>
    <p>{`Let us look at Movie sample dataset too.`}</p>
    <h3 {...{
      "id": "step-8-create-redis-database"
    }}>{`Step 8. Create Redis database`}</h3>
    <p><a parentName="p" {...{
        "href": "/explore/redismod"
      }}>{`Follow this link to create Redis database using Docker container `}</a>{`that comes with RediSearch module enabled`}</p>
    <h3 {...{
      "id": "step-9-install-redisinsight"
    }}>{`Step 9. Install RedisInsight`}</h3>
    <p><a parentName="p" {...{
        "href": "/explore/redisinsight/getting-started"
      }}>{`Follow this link`}</a>{` to setup RedisInsight locally in your system`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
    <h3 {...{
      "id": "step-10-movie-sample-database"
    }}>{`Step 10. Movie Sample Database`}</h3>
    <p>{`In this project you will use a simple dataset describing movies, for now, all records are in English. You will learn more about other languages in another tutorial.`}</p>
    <p>{`A movie is represented by the following attributes:`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`movie_id`}</inlineCode></strong>{` : The unique ID of the movie, internal to this database`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`title`}</inlineCode></strong>{` : The title of the movie.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`plot`}</inlineCode></strong>{` : A summary of the movie.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`genre`}</inlineCode></strong>{` : The genre of the movie, for now a movie will only have a single genre.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`release_year`}</inlineCode></strong>{` : The year the movie was released as a numerical value.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`rating`}</inlineCode></strong>{` : A numeric value representing the public's rating for this movie.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`votes`}</inlineCode></strong>{` : Number of votes.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`poster`}</inlineCode></strong>{` : Link to the movie poster.`}</li>
      <li parentName="ul"><strong parentName="li"><inlineCode parentName="strong">{`imdb_id`}</inlineCode></strong>{` : id of the movie in the `}<a parentName="li" {...{
          "href": "https://imdb.com"
        }}>{`IMDB`}</a>{` database.`}</li>
    </ul>
    <h4 {...{
      "id": "key-and-data-structure"
    }}>{`Key and Data structure`}</h4>
    <p>{`As a Redis developer, one of the first things to look when building your application is to define the structure of the key and data (data design/data modeling).`}</p>
    <p>{`A common way of defining the keys in Redis is to use specific patterns in them. For example in this application where the database will probably deal with various business objects: movies, actors, theaters, users, ... we can use the following pattern:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`business_object:key`}</inlineCode></li>
    </ul>
    <p>{`For example:`}</p>
    <ul>
      <li parentName="ul"><inlineCode parentName="li">{`movie:001`}</inlineCode>{` for the movie with the id 001`}</li>
      <li parentName="ul"><inlineCode parentName="li">{`user:001`}</inlineCode>{` the user with the id 001`}</li>
    </ul>
    <p>{`and for the movies information you should use a Redis `}<a parentName="p" {...{
        "href": "https://redis.io/topics/data-types#hashes"
      }}>{`Hash`}</a>{`. `}</p>
    <p>{`A Redis Hash allows the application to structure all the movie attributes in individual fields; also RediSearch will index the fields based on the index definition.`}</p>
    <h3 {...{
      "id": "step-11-insert-movies"
    }}>{`Step 11. Insert Movies`}</h3>
    <p>{`It is time now to add some data into your database, let's insert a few movies, using `}<inlineCode parentName="p">{`redis-cli`}</inlineCode>{` or `}<a parentName="p" {...{
        "href": "https://redislabs.com/redisinsight/"
      }}>{`Redis Insight`}</a>{`.`}</p>
    <p>{`Once you are connected to your Redis instance run the following commands:`}</p>
    <pre><code parentName="pre" {...{}}>{`> HSET movie:11002 title "Star Wars: Episode V - The Empire Strikes Back" plot "After the Rebels are brutally overpowered by the Empire on the ice planet Hoth, Luke Skywalker begins Jedi training with Yoda, while his friends are pursued by Darth Vader and a bounty hunter named Boba Fett all over the galaxy." release_year 1980 genre "Action" rating 8.7 votes 1127635 imdb_id tt0080684


> HSET movie:11003 title "The Godfather" plot "The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son." release_year 1972 genre "Drama" rating 9.2 votes 1563839 imdb_id tt0068646


> HSET movie:11004 title "Heat" plot "A group of professional bank robbers start to feel the heat from police when they unknowingly leave a clue at their latest heist." release_year 1995 genre "Thriller" rating 8.2 votes 559490 imdb_id tt0113277


> HSET "movie:11005" title "Star Wars: Episode VI - Return of the Jedi" genre "Action" votes 906260 rating 8.3 release_year 1983  plot "The Rebels dispatch to Endor to destroy the second Empire's Death Star." ibmdb_id "tt0086190"


`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image13.png").default} title="image_tooltip" /></p>
    <p>{`Now it is possible to get information from the hash using the movie ID. For example if you want to get the title, and rating execute the following command:`}</p>
    <pre><code parentName="pre" {...{}}>{`>> HMGET movie:11002 title rating

1) "Star Wars: Episode V - The Empire Strikes Back"
2) "8.7"



`}</code></pre>
    <p>{`And you can increment the rating of this movie using:`}</p>
    <pre><code parentName="pre" {...{}}>{`HINCRBYFLOAT movie:11002 rating 0.1
`}</code></pre>
    <p>{`But how do you get a movie or list of movies by year of release, rating or title?`}</p>
    <p>{`One option, would be to read all the movies, check all fields and then return only matching movies; no need to say that this is a really bad idea.`}</p>
    <p>{`Nevertheless this is where Redis developers often create custom secondary indexes using SET/SORTED SET structures that point back to the movie hash. This needs some heavy design and implementation.`}</p>
    <p>{`This is where the RediSearch module can help, and why it was created.`}</p>
    <h3 {...{
      "id": "step-12-redisearch--indexing"
    }}>{`Step 12. RediSearch & Indexing`}</h3>
    <p>{`RediSearch greatly simplifies this by offering a simple and automatic way to create secondary indices on Redis Hashes. (more datastructure will eventually come)`}</p>
    <p><img parentName="p" {...{
        "src": "https://github.com/RediSearch/redisearch-getting-started/blob/master/docs/images/secondary-index.png?raw=true",
        "alt": "Secondary Index"
      }}></img></p>
    <p>{`Using RediSearch if you want to query on a field, you must first index that field. Let's start by indexing the following fields for our movies:`}</p>
    <ul>
      <li parentName="ul">{`Title`}</li>
      <li parentName="ul">{`Release Year`}</li>
      <li parentName="ul">{`Rating`}</li>
      <li parentName="ul">{`Genre`}</li>
    </ul>
    <p>{`When creating a index you define:`}</p>
    <ul>
      <li parentName="ul">{`which data you want to index: all `}<em parentName="li">{`hashes`}</em>{` with a key starting with `}<inlineCode parentName="li">{`movies`}</inlineCode>{` `}</li>
      <li parentName="ul">{`which fields in the hashes you want to index using a Schema definition.`}</li>
    </ul>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p"><em parentName="strong">{`Warning: Do not index all fields`}</em></strong></p>
      <p parentName="blockquote">{`Indexes take space in memory, and must be updated when the primary data is updated. So create the index carefully and keep the definition up to date with your needs.`}</p>
    </blockquote>
    <h3 {...{
      "id": "step-13-create-the-index"
    }}>{`Step 13. Create the Index`}</h3>
    <pre><code parentName="pre" {...{}}>{`>> FT.CREATE idx:movie ON hash PREFIX 1 "movie:" SCHEMA title TEXT SORTABLE release_year NUMERIC SORTABLE rating NUMERIC SORTABLE genre TAG SORTABLE

"OK"
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image14.png").default} title="image_tooltip" /></p>
    <p>{`The database contains a few movies, and an index, it is now possible to execute some queries.`}</p>
    <h4 {...{
      "id": "query-all-the-movies-that-contains-the-string-war"
    }}>{`Query: All the movies that contains the string "`}<inlineCode parentName="h4">{`war`}</inlineCode>{`"`}</h4>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image15.png").default} title="image_tooltip" /></p>
    <h4 {...{
      "id": "query-limit-the-list-of-fields-returned-by-the-query-using-the-return-parameter"
    }}>{`Query: Limit the list of fields returned by the query using the RETURN parameter`}</h4>
    <p>{`The FT.SEARCH commands returns a list of results starting with the number of results, then the list of elements (keys & fields).`}</p>
    <p>{`As you can see the movie `}<em parentName="p">{`Star Wars: Episode V - The Empire Strikes Back`}</em>{` is found, even though you used only the word “war” to match “Wars” in the title. This is because the title has been indexed as text, so the field is `}<a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisearch/Escaping/"
      }}>{`tokenized`}</a>{` and `}<a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisearch/Stemming/"
      }}>{`stemmed`}</a>{`.`}</p>
    <p>{`Later when looking at the query syntax in more detail you will learn more about the search capabilities.`}</p>
    <p>{`It is also possible to limit the list of fields returned by the query using the `}<inlineCode parentName="p">{`RETURN`}</inlineCode>{` parameter, let's run the same query, and return only the title and release_year:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image16.png").default} title="image_tooltip" /></p>
    <h4 {...{
      "id": "query-all-the-movies-that-contains-the-string-war-but-not-the-jedi-one"
    }}>{`Query: All the movies that contains the string "war but NOT the jedi one"`}</h4>
    <p>{`Adding the string `}<inlineCode parentName="p">{`-jedi`}</inlineCode>{` (minus) will ask the query engine not to return values that contain `}<inlineCode parentName="p">{`jedi`}</inlineCode>{`.`}</p>
    <pre><code parentName="pre" {...{}}>{`_"war -jedi" RETURN 2 title release_year_
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image17.png").default} title="image_tooltip" /></p>
    <h3 {...{
      "id": "step-14-fuzzy-search"
    }}>{`Step 14: Fuzzy Search`}</h3>
    <p>{`All the movies that contains the string "gdfather using fuzzy search"`}</p>
